export default {

    // Actual Language
    language: "pt-br",

    // Home & Footer
    all_languages: [
      {
        name: "Alemão",
        cod: "de-de"
      },
      {
        name: "Português",
        cod: "pt-br"
      },
      {
        name: "Francês",
        cod: "fr-fr"
      },
      {
        name: "Inglês",
        cod: "en-us"
      }
    ],

    // Rodape
    footer: {
      copy: "Roteirizador - © Desenvolvido com muito carinho por Felipe Oliveira"
    },

    // Pagina Login
    page_login: {
      title: "Roteirizador",
      form: {
        email: {
          placeholder: "Digite seu e-mail aqui"
        },
        password: {
          placeholder: "Digite sua senha aqui"
        },
        button_submit:  {
          text: "Login"
        }
      },
      link_register: {
        text: "Criar minha conta"
      }
    },

    page_register: {
      title: "Roteirizador",
      form: {
        full_name: {
          placeholder: "Digite seu nome completo aqui"
        },
        email: {
          placeholder: "Digite seu e-mail aqui"
        },
        password: {
          placeholder: "Digite sua senha aqui"
        },
        button_submit:  {
          text: "Fazer meu Registro"
        }
      },
      link_login: {
        text: "Ir para o login"
      }
    },

    page_404: {
      main_title: "Pagina não encontrada",
      main_description: "Vish, esse link não existe",
      suggestion_description: "Mas já que esta aqui, por que não aproveita pra dar uma olhada no repositório do projeto?",
      or: "OU",
      link_login: {
        text: "Voltar ao Login"
      }
    },

    page_roteirizador: {
      main_title: "Roteirizador",
      form_roteirizador: {},
      preview_roteirizador: {},
      history_routes: {},
    },

}
